PREFIX dbr: <http://dbpedia.org/resource/>

# Step 1: Find the awardee of the United States Congress award
SELECT ?awardee WHERE {
  ?awardee dbo:award <dbr:United_States_Congress_Award> .
}

# Step 2: Find the war related to the awardee
UNION
SELECT ?war WHERE {
  ?war dbo:participant ?awardee .
}

# Step 3: Find the birthplace settlement of the awardee
UNION
SELECT ?birthplace WHERE {
  ?awardee dbo:birthPlace ?birthplace ;
             dbo:deceasedOn "1850-08-05" ;
             dbo:nationality dbr:American .
}

# Step 4: Combine all conditions to filter the results
UNION
SELECT ?awardee WHERE {
  ?awardee dbo:award <dbr:United_States_Congress_Award> ;
             dbo:birthPlace ?birthplace ;
             dbo:deceasedOn "1850-08-05" ;
             dbo:nationality dbr:American .
}
```

