  ?author dbo:militaryRank dbr:Commander_in_war ;
           dbo:disease dbr:Disease ;
           dbo:societalEvent dbr:Societal_event .

  # The author should have been a member of the United States Navy
  ?author dbo:militaryBranch dbr:United_States_Navy .

