  <http://dbpedia.org/resource/An_Invitation_to_the_White_House> dbo:writtenWork ?author ;
                                                          dbo:book ?author ;
                                                          dbo:work ?author .

  # Find the spouse of the author
  ?spouse dbo:spouse ?author .

  # The spouse should also be a politician and an office holder
  ?spouse dbo:occupation dbr:Politician ;
            dbo:officeHolder dbr:Office_holder .
}
