PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

# Step 1: Find Constance of Burgundy's spouse
SELECT ?spouse WHERE {
  ?spouse dbo:spouse <dbr:Constance_of_Burgundy> .
}

# Step 2: Find the child of that spouse who is a royalty
SELECT ?child1 WHERE {
  ?child1 dbo:parent ?spouse .
  FILTER(?child1 IN (VALUES(dbo:King, dbo:Queen)))
}

# Step 3: Identify the reference (which is also a royalty and an office holder) to William I
SELECT ?reference WHERE {
  ?reference dbo:officeHolder dbr:William_I_of_Normandy ;
             dbo:royalty true .
}

# Step 4: Find the father of that reference who is a royalty
SELECT ?father WHERE {
  ?father dbo:child ?reference .
  FILTER(?father IN (VALUES(dbo:King, dbo:Queen)))
}

# Step 5: Find the child of that father
SELECT ?child2 WHERE {
  ?child2 dbo:parent ?father .
}
```

