# Step 1: Find Maria Anna of Bavaria
SELECT ?mariaAnna WHERE {
  ?mariaAnna dbo:birthDate "1574"^^xsd:date .
}

# Step 2: Find her father
SELECT ?father WHERE {
  ?father dbo:child ?mariaAnna .
}

# Step 3: Find the child of Maria Anna's father
SELECT ?childOfFather WHERE {
  ?father dbo:child ?childOfFather .
}

# Step 4: Filter for royalty
SELECT ?royalChild WHERE {
  ?royalChild dbo:nationality "Royal" .
  FILTER(?royalChild IN (?childOfFather))
}

# Step 5: Find the child of this royal child
SELECT ?grandChild WHERE {
  ?royalChild dbo:child ?grandChild .
}

# Step 6: Find the father of this child
SELECT ?grandfather WHERE {
  ?grandfather dbo:child ?grandChild .
}
